import React, { useState, useEffect, useRef } from "react";
import Iframe from 'react-iframe'
import {useLocation, useNavigate} from 'react-router-dom';
import ReactDOM from 'react-dom';


import Draggable, {DraggableCore} from 'react-draggable'; // Both at the same time

// import "./styles.css";

function Home() {

    const [pics, setPics] = useState({url: 1}, {url: 2}, {url: 3}, {url: 4}, {url: 5}, {url: 6}, {url: 7}, {url: 8}, {url: 9})

    // const [pics, setPics] = useState([{url: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540838/portfolio/fern6mlmjjwor9tmkkcd.jpg'}, 
    // {url2: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540838/portfolio/rt9g5nhusgnzecab0mtp.jpg'},
    // {url3: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540838/portfolio/jp55qi05mwrs3zfmhtea.jpg'},
    // {url4: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540838/portfolio/f0x3qic5jugrwnzti3jv.jpg'},
    // {url5: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540840/portfolio/scmfokk7rnn1rsb2wrxs.jpg'},
    // {url6: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540838/portfolio/xqb9cdkpmykceya22ejm.jpg'},
    // {url7: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540839/portfolio/xieu9a6e7pk89ec3qyqi.jpg'},
    // {url8: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540839/portfolio/sz4ryajjuqh1qjxd81yd.jpg'},
    // {url9: 'https://res.cloudinary.com/dm63jyidg/image/upload/v1672540839/portfolio/pajxdrdvrwquk7lj5w6z.jpg'}])

    const dragItem = useRef();
    const dragOverItem = useRef();

    const dragStart = (e, position) => {
        dragItem.current = position;
        console.log(e.target.innerHTML);
    };

    const dragEnter = (e, position) => {
        dragOverItem.current = position;
        console.log(e.target.innerHTML);
    };


    const [drag, setDrag] = useState({
        activeDrags: 0,
        deltaPosition: {
          x: 0, y: 0
        },
        controlledPosition: {
          x: -400, y: 200
        }
      });

    const handleDrag = (e, ui) => {
        console.log('Handle Drag Event: ', e);
        let tempDrag = {...drag}
        const {x, y} = tempDrag.deltaPosition;
        setDrag({
          deltaPosition: {
            x: x + ui.deltaX,
            y: y + ui.deltaY,
          }
        });
      };

    const  handleStart = (e, position) => {
        console.log('Handle Start Position: ', position);
        console.log('Handle Start Event: ', e);
        setDrag({activeDrags: ++drag.activeDrags});
      };

    const  handleStop = (e) => {
        console.log('Handle Stop Event: ', e);
        setDrag({activeDrags: --drag.activeDrags});
        };

return (
    <>
    <div className="full-block-home">
        <div class="block-1"></div>
        <div class="block-2">
            <h5>Hi all, I am</h5>
            <h1 className="pink-text">Trang Do Thuy</h1>
            <h3 className="blue-text">&gt; Full-Stack Developer</h3>
            <br/>
            <h6 className="purple-text"> &#47;&#47; 	&nbsp;complete the game to continue</h6>
            <h6 className="purple-text"> &#47;&#47; 	&nbsp;you can also see it on my Github page</h6>
            <h6> <span  className="orange-text">const</span> <span className="green-text">githubLink</span> <span className="white-text">=</span> <span className="yellow-text">"https://github.com/trngdothuy"</span></h6>
            {/* <button className="big-button" type= "button" onClick={()=>navigate('/factorytour')}>See more</button> */}
        </div>
        <div class="block-3">
            {/* <h5>Pictures</h5> */}
            {/* <canvas className="canvas"/> */}
            <div className="home-picture">
            {
                pics&&
                pics.map((pic, index) => (
                <div style={{backgroundColor:'lightblue', margin:'20px 25%', textAlign:'center', fontSize:'40px'}}
                    onDragStart={(e) => dragStart(e, index)}
                    onDragEnter={(e) => dragEnter(e, index)}
                    onDragEnd={drop}
                    key={index}
                    draggable>
                    {pic.urlindex}
                </div>
                ))}


                {/* <div className="pic-line">  */}
                {/* 1st line, 1 - 4 - 7 */}
                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        // onDrag={handleDrag}
                        onStop={handleStop}
                        defaultPosition={{x: 0, y: 0}}
                        >
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url1})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}>
                            </div>
                        </Draggable>
                    {/* </div> */}

                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        defaultPosition={{x: 0, y: 0}}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url4})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div> */}

                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url7})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                </div> */}

                {/* <div className="pic-line"> */}
                    {/* 2nd line, 2 - 5 - 8 */}
                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url2})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url5})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url8})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                // </div>

                <div className="pic-line"> */}
                    {/* 3rd line, 3 - 6 - 9 */}
                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url3})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single=pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                        <div className="handle1" style={{position: 'relative',
                            background: `url(${url6})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div> */}

                    {/* <div className="single=pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                        <div className="handle1" style={{position: 'relative',
                            background: `url(${url9})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div> */}

                {/* </div> */}






            </div>               
        </div>
    </div></>
);
}

export default Home;
